import React from 'react';

const CuratorDashboard = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h1 style={{ fontSize: '24px', marginBottom: '10px' }}>Curator Dashboard</h1>
      <div>
        <h2 style={{ fontSize: '20px', marginTop: '20px' }}>Upcoming Exhibitions</h2>
        <p style={{ fontSize: '16px' }}>Overview of upcoming exhibitions and important dates.</p>
      </div>
      <div>
        <h2 style={{ fontSize: '20px', marginTop: '20px' }}>Recent Activity</h2>
        <p style={{ fontSize: '16px' }}>Summary of recent content updates and tasks.</p>
      </div>
    </div>
  );
};

export default CuratorDashboard;
